import { Table, Menu, Dropdown, Button, Collapse } from "antd";
const { Panel } = Collapse;
const { Column, ColumnGroup } = Table;
const data = [
  {
    key: "Padrao",
    c: "ºC",
    bico1: "295",
    cil2: "290",
    cil3: "285",
    cil4: "280",
    tolerancia: "10",
    
  },
];

const onChange = (activeKey) => {
    console.log(`onChange ${activeKey}`);
  };


const App = () => (
  

    <Collapse size="small" defaultActiveKey={['1']} onChange={onChange}>
      <Panel header="Temperatura das Resistências do Fuso" key="1">
      <Table dataSource={data} pagination={false}>
        <Column title="" dataIndex="key" key="key" />
        <Column title="Unidades" dataIndex="c" key="c" />
        <Column title="1-Bico" dataIndex="bico1" key="bico1" />
        <Column title="2-Cil" dataIndex="cil2" key="cil2" />
        <Column title="3-Cil" dataIndex="cil3" key="cil3" />
        <Column title="4-Cil" dataIndex="cil4" key="cil4" />
        <Column title="Tolerancia. Max(+/-)" dataIndex="tolerancia" key="tolerancia" />

        
        
      </Table>
      </Panel>
      </Collapse>
    
);
export default App;
